//import logo from './logo.svg';
import { Box } from '@material-ui/core';
import * as React from 'react';
//import './App.css';
import { Navbar } from "./components/NavBar";
import { Page } from './components/Page';

const App: React.FC = () => {
  return (
    <React.Fragment>
      <Navbar/>
      <Box paddingTop={'90px'}>
        <Page title={'Categorias'}/>
      </Box>
    </React.Fragment>
  );
}

export default App;
